import React from 'react';
import { Container, Card, CardHeader, CardBody, Text, Heading, Stack, Input, InputGroup, InputRightElement, Button } from '@chakra-ui/react'

function Login() {

    const [show, setShow] = React.useState(false)
    const handleClick = () => setShow(!show)

    return (
        <Container>
            <Card>
                <CardHeader>
                    <Heading>Login</Heading>
                </CardHeader>
                <CardBody>
                    <Stack align="start">
                        <Text>Username</Text>
                        <Input />
                        <Text>Password</Text>
                        <InputGroup size='md'>
                            <Input
                                pr='4.5rem'
                                type={show ? 'text' : 'password'}
                                placeholder='Enter password'
                            />
                            <InputRightElement width='4.5rem'>
                                <Button h='1.75rem' size='sm' onClick={handleClick}>
                                    {show ? 'Hide' : 'Show'}
                                </Button>
                            </InputRightElement>
                        </InputGroup>
                    </Stack>
                </CardBody>
            </Card>
        </Container>
    );
}

export default App;
